import React from 'react';
import './Sidelist.css';
import profilepic from '../../../Images/faithful.jpg';

const Sidelist = (props) => {
  return (
    <div>
        {
            props.showProfilePic ? (<div className='profilepic'>
                                <img src={profilepic} alt='profile pic'></img>
                            </div>) : null
        }
    </div>
  )
}

export default Sidelist
